import React, {useState, useEffect} from 'react'
import './App.css';
import MaterialTable from 'material-table'


function App() {

  const [data, setData] = useState([])
  const columns = [
    { title:'Episodio',field: 'id'},
    { title:'Pais', field: 'country'},
    { title:'Universidad', field: 'name'},
    { title:'Dominio', field: 'domains'},
    { title:'Website', field: 'web_pages'},
  ]

  useEffect(()=>{
    fetch("https://rickandmortyapi.com/api/")
    .then(res => res.json())
    .then(res =>{
      setData(res)})
  })

  return (
    <div className="App">
      <h1 align="center">Dirrectorio de universidades</h1>
      <h4>Material Table UI</h4>
      <MaterialTable
        title="Universidades Del Mundo"
        data={data}
        columns={columns}
        options={{
          search:true,
          paging:true
        }}
      />  
    </div>
  );
}

export default App;
